import axios from 'axios';

const url = 'http://localhost:3000/cards/:id';

export const getWords = async(card_id) => {
  return await axios.get(url,{ withCredentials: true })
    .then(function (response) {
      return response;
    })
    .catch(function (error) {
      console.log(error);
    });
}
